package prp;
import java.util.*;
public class Swapping {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int n1=sc.nextInt();
		int n2=sc.nextInt();
		int temp;
		temp=n1;
		n1=n2;
		n2=temp;
		System.out.println(n1+" "+n2);
	}

}
